import s from './friendList.module.css'

const FriendList = (props) =>{

  let lff_b = ''
  if (props.type == 'loggedUsersProfile'){
    lff_b = <button>Look for friends!</button>
  } else {
    lff_b = <div></div>
  }

  let friendElems = props.friends.map((friend)=>{
    return <div className={s.friendElem}><div>friend.usersInfo.profilePhoto</div> <div>friend.name</div></div>
  })

  return (
    <div className={s.friend_list}>
      <div>Friendlist</div>
      <div className={s.list_of_friends}>
        <div className={s.friendElem}><div>Img</div> <div>Friend 1</div></div>
        <div className={s.friendElem}><div>Img</div> <div>Friend 2</div></div>
        <div className={s.friendElem}><div>Img</div> <div>Friend 3</div></div>
        <div className={s.friendElem}><div>Img</div> <div>Friend 4</div></div>
        <div className={s.friendElem}><div>Img</div> <div>Friend 5</div></div>
      </div>

      <div className={s.pagesNButtons}>
        <button>Back</button>
        <div>1</div>
        <button>Forward</button>
      </div>

      <div className={s.lff}>
        <div></div>
        {lff_b}
        <div></div>
      </div>
  </div>
  );
}

export default FriendList;
